import React from 'react';
import './home.css';
import Navbar from '../../components/Navbar/navbar.jsx';

import Footer from '../../components/Footer/footer.jsx';
import Card from '../../components/Card/card.jsx';


function Home() {
  return (
    <div>
      <Navbar />
      <Card />
      
      <Footer/>
    </div>
  );
}

export default Home;
